import { useState } from "react";

import Form from "./Form";
import Table from "./Table";

function Buttons()
{
    const [view, setView] = useState(null);
    return(
        <>
            <div>
                <button onClick={() => setView("form")}>Form</button>
                <button>Table</button>
            </div>
        </>
    )
}

export default Buttons;
